import React, {Component} from 'react';
import './App.css';
import Todos from './components/Todos'

class App extends Component{
  state = {
    todos: [
      {
        id: 1,
        title: "Go out.",
        completed: true
      },
      {
        id: 2,
        title: "Go home.",
        completed: false
      },
      {
        id: 3,
        title: "Sleep.",
        completed: false
      }
    ]
  }
  render() {
    <div className="App">
      <Todos />
    </div>
  }
}

export default App;
